      <div className="SIntrapara">
        Applies <span className="RktVar">proc</span> to the elements of the{" "}
        <span className="RktVar">lst</span>s from the first elements to the
        last. The <span className="RktVar">proc</span> argument must accept the
        same number of arguments as the number of supplied{" "}
        <span className="RktVar">lst</span>s, and all{" "}
        <span className="RktVar">lst</span>s must have the same number of
        elements. The result is a list containing each result of{" "}
        <span className="RktVar">proc</span> in order.
      </div>
